#פונקצייה לטעינת תמונות, והמרתן לטנסור
def load(face_image,comic_image):
    image_face = tf.io.read_file(face_image) #הגדרת נתיב תמונת הפנים
    image_face = tf.io.decode_jpeg(image_face) #המרת התמונה לטנסור של ערכים בין 0-255
    image_comic = tf.io.read_file(comic_image) #הגדרת נתיב תמונת הקומיקס
    image_comic = tf.io.decode_jpeg(image_comic) #המרת התמונה לטנסור של ערכים בין 0-255
    face_image = tf.cast(image_face, tf.float32) #המרה לערכים בין 0.0-255.0
    comic_image = tf.cast(image_comic, tf.float32) #המרה לערכים בין 0.0-255.0
    return face_image,comic_image
#אותה פונקציה רק לתמונת פנים אחת
def load_one_image(input_image):
    input_image = tf.io.read_file(input_image)
    input_image = tf.io.decode_jpeg(input_image)
    input_image = tf.cast(input_image, tf.float32)
    return input_image

