def generate_images(model, test_input, tar):
    prediction = model(test_input, training=True)
    plt.figure(figsize=(15, 15))

    display_list = [test_input[0], tar[0], prediction[0]]
    title = ['Input Image', 'Ground Truth', 'Predicted Image']

    for i in range(3):
        plt.subplot(1, 3, i+1)
        plt.title(title[i])
        # Getting the pixel values in the [0, 1] range to plot.
        plt.imshow(display_list[i] * 0.5 + 0.5)
        plt.axis('off')
    plt.show()
#פונקציה שמקבלת מודל, תמונת בסיס ותמונת מטרה ומחזירה את מה שקיבלה, את התמונה הרצויה ואת תוצר המודל

import numpy as np # import NumPy library

def genneratedImageForGan(model, input):
    # Add a batch dimension to the input
    input_array = np.expand_dims(input, axis=0)
    # Now you can pass the input_array to the model
    predict = model(input_array, training=True)

    # Remove the batch dimension for display (or further processing)
    predict = np.squeeze(predict, axis=0)

    return predict

def generate_images_in_real_live(model, test_input):
    prediction = model(test_input, training=True)
    plt.figure(figsize=(10, 10))

    display_list = [test_input[0], prediction[0]]
    title = ['Input Image', 'Predicted Image']

    for i in range(2):
        plt.subplot(1, 2, i+1)
        plt.title(title[i])
        # Getting the pixel values in the [0, 1] range to plot.
        plt.imshow(display_list[i] * 0.5 + 0.5)
        plt.axis('off')
    plt.show()
