@tf.function
def train_step(input_image, target, step):
  with tf.GradientTape() as gen_tape, tf.GradientTape() as disc_tape:
    gen_output = generator(input_image, training=True)
    # תוצר הגנרטור

    disc_real_output = discriminator([input_image, target], training=True)
    #חישוב האם התמונה אמיתית
    disc_generated_output = discriminator([input_image, gen_output], training=True)
    #חישוב האם התמונה מזוייפת

    gen_total_loss, gen_gan_loss, gen_l1_loss = generator_loss(disc_generated_output, gen_output, target)
    disc_loss = discriminator_loss(disc_real_output, disc_generated_output)
    #הגדרת העלות בהתאם לתוצאות הדיסקרימינייטור
  generator_gradients = gen_tape.gradient(gen_total_loss,
                                          generator.trainable_variables)
  discriminator_gradients = disc_tape.gradient(disc_loss,
                                               discriminator.trainable_variables)
#חישוב השיפועים
  generator_optimizer.apply_gradients(zip(generator_gradients,
                                          generator.trainable_variables))
  discriminator_optimizer.apply_gradients(zip(discriminator_gradients,
                                              discriminator.trainable_variables))
#יישום השיפועים ועדכון המשקלים

  with summary_writer.as_default():
    tf.summary.scalar('gen_total_loss', gen_total_loss, step=step//40)
    tf.summary.scalar('gen_gan_loss', gen_gan_loss, step=step//40)
    tf.summary.scalar('gen_l1_loss', gen_l1_loss, step=step//40)
    tf.summary.scalar('disc_loss', disc_loss, step=step//40)
    #הוספת הנתונים לבורד כל 40 תמונות

def fit(train_ds, test_ds, steps):
  example_input, example_target = next(iter(test_ds.take(1)))
  #לקיחת תמונת דוגמה
  start = time.time()

  for step, (input_image, target) in train_ds.repeat().take(steps).enumerate():
    if (step) % 1000 == 0:
      if step != 0:
        print(f'Time taken for 1000 steps: {time.time()-start:.2f} sec\n')
        #הדפסת כמות הזמן שלקח ל1000 תמונות

      start = time.time()

      generate_images(generator, example_input, example_target)
      print(f"Step: {step//1000}k")
      #הדפסת תוצר של הגנרטור כל 1000 תמונות

    train_step(input_image, target, step)

    # Training step
    if (step+1) % 10 == 0:
      print('.', end='', flush=True)

#הדפסת נקודה כל 10 תמונות
    # Save (checkpoint) the model every 5k steps
    if (step + 1) % 5000 == 0:
      checkpoint.save(file_prefix=checkpoint_prefix)
