def remove_background_as_tensor_white_bg(image_path):
    with open(image_path, "rb") as i:
        input_bytes = i.read()
    output_bytes = remove(input_bytes)

    # פתיחת תמונה עם שקיפות
    image = Image.open(io.BytesIO(output_bytes)).convert("RGBA")
    np_image = np.array(image)

    # יצירת רקע לבן במקומות השקופים
    alpha = np_image[:, :, 3] / 255.0
    rgb = np_image[:, :, :3]

    # רקע לבן
    white_bg = np.ones_like(rgb) * 255

    # מיזוג לפי שקיפות
    blended = rgb * alpha[..., None] + white_bg * (1 - alpha[..., None])
    blended = blended.astype(np.uint8)

    return tf.convert_to_tensor(blended, dtype=tf.float32)

